var cross = {
  width : 176, height : 176, bpp : 4,
  transparent : 12,
  buffer : require("heatshrink").decompress(atob(""))
};

var background = {
  width : 176, height : 176, bpp : 1,
  buffer : atob("")
};

var leftarm = {
  width : 76, height : 27, bpp : 4,
  transparent : 0,
  buffer : atob("")
};

var body_mask = {
  width : 176, height : 176, bpp : 2,
  transparent : 0,
  buffer : atob("")
};

var background2 = {
  width : 176, height : 176, bpp : 3,
  transparent : 5,
  buffer : require("heatshrink").decompress(atob(""))
};

var body = {
  width : 176, height : 176, bpp : 2,
  transparent : 1,
  buffer : atob("")
};

var left_mask = {
  width : 152, height : 36, bpp : 2,
  transparent : 0,
  buffer : atob("")
};

var left = {
  width : 152, height : 36, bpp : 2,
  transparent : 1,
  buffer : atob("")
};

var right_mask = {
  width : 152, height : 36, bpp : 2,
  transparent : 0,
  buffer : atob("")
};

var right = {
  width : 152, height : 36, bpp : 2,
  transparent : 1,
  buffer : atob("")
};


function draw(h,m) {
  g.drawImage(background2);
  g.drawImage(cross);
  //g.drawImage(body_mask);
  
  const m180 = 2*Math.PI/60;
  const h180 = 2*Math.PI/12;
  
  //if ((m)>15 && (m)<45) {
    g.drawImage(body_mask);
    g.drawImage(body);
    g.drawImage(right_mask, 90,62, {  "rotate": (m-15)*m180 });
    g.drawImage(right, 90,65, { "rotate": (m-15)*m180 });
//  }
 // else {
  //  g.drawImage(right_mask, 90,62, {  "rotate": (m-15)*m180 });
 //   g.drawImage(right, 90,65, { "rotate": (m-15)*m180 });
 //   g.drawImage(body_mask);
 //   g.drawImage(body);
//    }
  
  g.drawImage(left_mask, 90,62, {  "rotate": (h-3+m/60)*h180 });
  g.drawImage(left, 90,65, { "rotate": (h-3+m/60)*h180 });  
}

function tick() {
  var d = new Date();
  var h= d.getHours();
  if (h>12) h = h -12;
  draw(h,d.getMinutes());
  s = d.getSeconds();
  setTimeout(tick, 1000 * (60-s));
}

tick();

// listen for button press, convenience to exit
Bangle.setUI("clock");



